import {Button, Container, Navbar} from 'react-bootstrap';
import './App.css';
import { Alert,Accordion } from "react-bootstrap";

const  App = () => {
  return (
    <div>
      <Navbar bg="success" expand='sm' variant='dark'>
        <Container>
          <Navbar.Brand href='/'>Home</Navbar.Brand>
        </Container>
      </Navbar>

    </div>
  );
}

export default App;
